import json
from flask import request, Blueprint
from captcha_app.utils import imgutils
from captcha_app.ocr import ocrvd

captcha_blue = Blueprint('routes', __name__)

logout = '''
<!doctype html>
<head>
  <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
  <title>PT验证码识别</title>
  <style type="text/css">body { margin: 0; padding: 0; background: #efefef; font-family: Georgia, Times, Verdana, Geneva, Arial, Helvetica, sans-serif; } div#mother { margin: 105px auto 0 auto; width: 943px; height: 572px; position: relative; } div#errorBox { background: url(data:image/png;base64,)
    no-repeat top left; width: 943px; height: 572px; margin: auto; } div#errorText { color: #39351e; padding: 0 -10 0 0 } div#errorText h1 { font-size: 40px; position: relative; width: 540px; left: 50px; top: 60px; } h3 { position: relative; width: 480px; left: 360px; top: 260px; } #time { color: #FF0000; font-size: 50px; font-weight: bold; position: relative; left: 780px; top: 260px; }</style>
  <script>//定义函数myClose关闭当前窗口
    function myClose() {
      //将id为time的元素的内容转为整数，保存在变量n中
      var n = parseInt(time.innerHTML);
      n--; //将n-1
      //如果n==0,关闭页面
      //否则, 将n+秒钟后自动关闭，再保存回time的内容中
      if (n > 0) {
        time.innerHTML = n + "S";
        timer = setTimeout(myClose, 1000);
      } else {
        location.href = '/current_ocr';
      }
    }
    var timer = null;
    //当页面加载后，启动周期性定时器，每个1秒执行myClose
    window.onload = function() {
      timer = setTimeout(myClose, 1000);
    }</script>
</head>
<body>
  <div id="mother">
    <div id="errorBox">
      <div id="errorText">
        <h1>PT_Captcha程序启动成功！</h1>
        <h3>PT验证码识别程序会自动跳转到服务提供商检测接口。
          <br />
          <br />&ensp;&ensp;-----火星不太安全，我可以免费送你回地球-----</h3>
        <span id="time">10S</span></div>
    </div>
  </div>
</body>
'''


@captcha_blue.route('/', methods=['GET'])
def index():
    return logout


@captcha_blue.route('/current_ocr', methods=['GET'])
def current_ocr():
    return ocrvd.current_ocr()


@captcha_blue.route('/upload', methods=['GET', 'POST'])
def upload():
    if request.method == 'GET':
        return logout
    imgbase64 = json.loads(request.data).get('image')
    if not imgbase64:
        print('cannot get image base64 data from payload')
        return 'ERROR: image not found!'
    gray_imgbase64 = imgutils(imgbase64).denoise()
    return ocrvd.ocr_output(gray_imgbase64), 200
